fe3ea2d576683588fad2c40c68344bef78540bfa:
query GetAllVehicles {
  vehicles(first: 25, orderBy: blockTimestamp, orderDirection: desc) {
    id
    partner
    vin
    blockNumber
    blockTimestamp
    transactionHash
  }
}

7bf859e634922509d3dd121c957349b459119872:
query GetVehicles($partner: Bytes) {
  vehicles(
    first: 25
    orderBy: blockTimestamp
    orderDirection: desc
    where: {partner: $partner}
  ) {
    id
    partner
    vin
    blockNumber
    blockTimestamp
    transactionHash
  }
}
